import React from 'react';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import './Home.css'

const Home = () => {

      const select_god = React.useCallback(() => {
        console.log("posting");
        let mode = 'god';
        const url = 'http://172.28.90.45:8080/mode';
        const formData = new FormData();
        formData.append('mode', mode);

        fetch(url, { //change!!
          method: 'POST',
          body: formData,
        })
          .then((response) => response.json())
          .then((data) => console.log(data))
          .catch((error) => console.error(error));
      });

      const select_normal = React.useCallback(() => {
        console.log("posting");
        let mode = 'normal';
        const url = 'http://172.28.90.45:8080/mode';
        const formData = new FormData();
        formData.append('mode', mode);

        fetch(url, { //change!!
          method: 'POST',
          body: formData,
        })
          .then((response) => response.json())
          .then((data) => console.log(data))
          .catch((error) => console.error(error));
      });

    return (
    <div>
      <img src='./Images/rpshand.jpg' alt=""/>
      <div className="mode_selection">
        <Link to="/Title">
          <Button onClick={select_normal} className="Title">
            Normal
          </Button>
        </Link>
        <Link to="/Title">
          <Button onClick={select_god} className="Title">
            GodMode
          </Button>
        </Link>
      </div>
    </div>
      
    );
  }

  export default Home
